tabs.description:
In the triples tab we have the Common BIM file [Duplex house](https://www.nibs.org/page/bsa_commonbimfiles#project1) converted to a Linked Building Data (LBD) graph using the [IFCtoLBD](https://github.com/jyrkioraskari/IFCtoLBD) converter by Jyrki Oraskari. A good starting point when browsing an unfamiliar graph is to ask for all the distinct properties that exists on a certain kind of resource.

The first part of the triple path in the *WHERE* clause of the query asks for all instances of [bot:Element](https://w3id.org/bot#Element). The next part simply binds all properties and values (predicates and objects) that exist on these element instances to variables `?prop` and `?val`. Only the values bound to the `?prop` variable are returned, and the *DISTINCT* keyword ensures that only the unique ones are returned.

Next step is to change the query to return the particular property of interest. For example:

```
SELECT *
WHERE {   
    ?element a bot:Element ;
        props:host_simple ?val .
}
```

The same approach can be used for instances of [bot:Space](https://w3id.org/bot#Space) (or [bot:Site](https://w3id.org/bot#Site), [bot:Building](https://w3id.org/bot#Building), p4bldg:Wall, p4bldg:Window etc.)

```
SELECT DISTINCT ?prop
WHERE {   
    ?sp a bot:Space ;
        ?prop ?val .
}
```
